import './App.css';
import DopComponent from './defaultComponents'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <DopComponent
          helloText={'My name is Alina'}
          isAdmin={true}
          count={4321}
        />
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>

      </header>
    </div>
  );
}

export default App;
